import React ,{Component} from 'react'
import PathData from './Data'
import Card from './Card'
import H3 from './H3'

class Bg0001 extends Component {
    render(){
        const num1 = 1
        return(
            PathData.map((data,i) => {
                return(       
                    num1 === i?
                    <div className = 'bg000'>
                        <div className = 'container-types clearfix'>
                            <H3
                                data = {data}
                                i = {i} 
                            />
                            <div className = "clearfix types-content">
                                <Card 
                                    card = {data.card}
                                    ID = {i}
                                    // curr = {this.state.curr}
                                />
                            </div>
                        </div>
                    </div>
                    :null
                )
            })
        )
    }
}

export default Bg0001
